import React from 'react';
import './progress.scss';
import {Box} from '@mui/material'

export default function Progress() {
  return (
    <Box>
        <Box className='progress__container'>
            <li className='progress__steps'>ERFC</li>
            <li className='progress__steps'>HSE</li>
            <li className='progress__steps'>Commissi</li>
            <li className='progress__steps'>SAP</li>
            <li className='progress__steps'>LOTO</li>
            <li className='progress__steps'>AP</li>
        </Box>
    </Box>
  )
}
